const Header =({ isProfileOpen, toggleModalm, name}) => {

  return (

  	<div style= {{display: 'Block', justifyContent: 'center' }} >
  	   <h1 >{'corey mcallen'}</h1>

       <div className="" style={{ float: 'right',  display: 'inline' }}>
       <img src="http://tachyons.io/img/logo.jpg"  className=" h3 w3 dib"  alt="avatar" style={{justifyContent: 'right' }}/>

       </div> 
    </div> 
  )
}

export default Header;
